            link={Sdata[1].links}
        />

        <Card
            imgsrc={Sdata[2].imgsrc}
            title={Sdata[2].title}
            sname={Sdata[2].sname}
            link={Sdata[2].links}
        /> */}

        {Sdata.map( (val) =>{
            return (
                <Card
                key={id}
                    imgsrc={val.imgsrc}
                    title={val.title}
                    sname={val.sname}
                    link={val.links}
                />
            )
        })}
    </>
